import React from 'react';
import styles from './AdminUserManagement.module.css'; // 假设有相应的CSS模块

const AdminUserManagement = () => {
    // 模拟处理函数，实际开发中可替换为具体逻辑
    const handleActionClick = (message) => {
        alert(message);
    };

    return (
        <div className={styles.container}>
            <div className={styles.feature}>
                <h2>NYC-5 User Management</h2>
                <button className={styles.button} onClick={() => handleActionClick('Manage the users of the system')}>
                    Manage the users of the system
                </button>
            </div>
            <div className={styles.feature}>
                <h2>NYC-19 Admin Users can create and edit users in the system</h2>
                <button className={styles.button} onClick={() => handleActionClick('Admin creates or edits users')}>
                    Admin creates or edits users
                </button>
            </div>
            <div className={styles.feature}>
                <h2>NYC-20 Users can edit their profile</h2>
                <button className={styles.button} onClick={() => handleActionClick('User edits their profile')}>
                    User edits their profile
                </button>
            </div>
            <div className={styles.feature}>
                <h2>NYC-21 Users can change their password</h2>
                <button className={styles.button} onClick={() => handleActionClick('User changes their password')}>
                    User changes their password
                </button>
            </div>
            <div className={styles.feature}>
                <h2>NYC-22 Admin user can add and edit work team details</h2>
                <button className={styles.button} onClick={() => handleActionClick('Admin adds or edits work team details')}>
                    Admin adds or edits work team details
                </button>
            </div>
        </div>
    );
};

export default AdminUserManagement;
